def exgcd(r,e):
	s = [[r,1,0], [e,0,1]]
	while s[1][0] != 1:
		t0 = s[0]
		t1 = s[1]
		s[0] = s[1]
		q = t0[0]//t1[0]
		s[1] = [t0[0]-q*t1[0], t0[1]-q*t1[1], t0[2]-q*t1[2]]
	if s[1][2] < 0:
		return s[1][2]+r
	else:
		return s[1][2]

